test_list_of_tens:
assert {2} == {2, 5}
  Extra items in the right set:
  5
  Full diff:
  - {2, 5}
  + {2}

test_powers_of_two:
assert {5, 11, 13} == {2}
  Extra items in the left set:
  5
  11
  13
  Extra items in the right set:
  2
  Full diff:
  - {2}
  + {13, 11, 5}

test_list_of_primes:
assert set() == {2}
  Extra items in the right set:
  2
  Full diff:
  - {2}
  + set()
